import classes from "./../../css/Dialogs.module.css";
import { NavLink } from 'react-router-dom';
import Contacts from "./Contacts";
import Messages from "./Messages";
import Contact from "./Contact";


const Dialogs = (props) => {

	let contactArr = [
		{ id: 0, name: "Даун Иваныч" },
		{ id: 1, name: "Лох Иваныч" },
		{ id: 2, name: "Мочевин Уретров" }
	]

	let contactElements = contactArr.map(contact =>
		<Contact name={contact.name} id={contact.id} />
	);

	return (
			<div className={classes.dialogBox}>
				<Contacts contacts={contactArr}/>
				<Messages />
			</div>
		
	);
}

export default Dialogs;
